    "Frank Raoul-Duval, 젊은 사람은 프랑스 귀족에서 나옵니다. 그는 혁신적인 디자인을 1982 년에 \"split-sole ballet shoes\" 을 제안했습니다. 많은 시련과 조정 후, 분할 단독 부드러운 신발 Pro1C 태어났다.",
    "1994 년에 파리 박람회에서, 이 쪼개지는 유일한 Sansha 춤 신발은 중대한 감각을 가져오고 세계에 있는 가장 큰 혁명과 혁신이라고 한 수많은 applause를 이겼습니다.",
    "30 년 이상의 개발 후 Sansha 브랜드 커버 거의 모든 종류의 댄스 신발, 의류 및 액세서리, 전세계 200 전문 발레 댄스 그룹과 협력, 전문 댄서를위한 맞춤형 무대 성능 제품 제공.",
    "주문품 및 특별한 순서",
    "우리는 우리의 자신 공장과 디자이너가 있고, 우리는 온갖 고품질 춤 단화를 생성해서 좋습니다: 탱고, 라틴어, 재즈, 발레 신발 등등&hellip;.",
    "우리는 또한 고객 주문품 및 특별한 순서를 받아들일 수 있습니다, pls는 첫째로 우리의 소비자 봉사 직원과 가진 세부사항을 토론합니다.",
    "당신의 신뢰를 위한 감사합니다, 우리는 당신을 봉사하기 위하여 최선을 다할 것입니다.",
