    "우리는 불특정 요인의 제비로 인해 국제 출하에 배달 시간을 보장 할 수 없습니다. 그러나 소포가 예상 시간 안에 도착하지 않는 경우에, 저희에게 연락하십시오, 우리는 그것을 추적하고 당신에게 만족된 대답을 줄 것을 도울 것입니다.",
